                    />
                  </Form.Group>
                </Col>
              </Row>
              <Row>
                <Col>
                  <Form.Group
                    as={Col}
                    controlId="formGridLastName"
                    className="formmargin"
                  >
                    <Form.Label>Start</Form.Label>
                    <Form.Control
                      type="date"
                      required
                      name="start"
                      value={details.start}
                      onChange={handleeducationdetails}
                      //   disabled={disableFields}
                    />
                  </Form.Group>
                </Col>
                <Col>
                  <Form.Group
                    as={Col}
                    controlId="formGridLastName"
                    className="formmargin"
                  >
                    <Form.Label>End</Form.Label>
                    <Form.Control
                      type="date"
                      required
                      name="end"
                      value={details.end}
                      onChange={handleeducationdetails}
                      //   disabled={disableFields}
                    />
                  </Form.Group>
                </Col>
                <Col>
                  <Form.Group
                    as={Col}
                    controlId="formGridLastName"
                    className="formmargin"
                  >
                    <Form.Label>Status</Form.Label>
                    <Form.Select
                      required
                      name="status"
                      placeholder="status"
                      value={details.status}
                      onChange={handleeducationdetails}
                      //   disabled={disableFields}
                    >
                      <option value="" selected hidden disabled>
                        Please Select
                      </option>
                      <option>Completed</option>
                      <option>In progress</option>
                    </Form.Select>
                  </Form.Group>
                </Col>
              </Row>

              <div className="d-flex justify-content-center my-3">
                <Button
                  onClick={() => {
                    addeducation();
                    Closechildmodal1();
                  }}
                >
                  Add Education
                </Button>
              </div>
            </Container>
          </Modal.Body>
        </Modal>
        {/* //employement history modal */}
        <Modal
                      aria-labelledby="contained-modal-title-vcenter"
                      centered
                      show={childModel}
                      onHide={Closechildmodal}
                      size="lg"
                    >
                      <Modal.Header closeButton>
                        <Modal.Title
                          id="contained-modal-title-vcenter "
                          style={{ textAlign: "center" }}
                        >
                          <h5>Eployement Details</h5>
                        </Modal.Title>
                      </Modal.Header>
                      <Modal.Body>
                        <Container fluid>
                          <Row>
                            <div className="py-3">
                              <h4>Previous Employment</h4>
                              <hr
                                style={{
                                  fontWeight: "bold",
                                  borderWidth: "2px",
                                  border: "1px solid black",
                                }}
                              ></hr>
                            </div>

                            <Col>
                              <Form.Group
                                as={Col}
                                controlId="formGridempcompany"
                                className="formmargin"
                              >
                                <Form.Label>Company</Form.Label>
                                <Form.Control
                                  type="text"
                                  required
                                  name="company"
                                  placeholder="company name.."
                                  value={empdetails.company}
                                  onChange={handleempinput}
                                  //   onChange={handleinput}
                                  //   disabled={disableFields}
                                />
                              </Form.Group>
                            </Col>
                            <Col>
                              <Form.Group
                                as={Col}
                                controlId="formGridLastName"
                                className="formmargin"
                              >
                                <Form.Label>Position</Form.Label>
                                <Form.Control
                                  type="text"
                                  required
                                  name="position"
                                  placeholder="position.."
                                  value={empdetails.position}
                                  onChange={handleempinput}
                                  //   disabled={disableFields}
                                />
                              </Form.Group>
                            </Col>
                          </Row>
                          <Row>
                            <Col>
                              <Form.Group
                                as={Col}
                                controlId="formGridFirstName"
                                className="formmargin"
                              >
                                <Form.Label>Joining Date</Form.Label>
                                <Form.Control
                                  type="date"
                                  required
                                  name="joiningdate"
                                  placeholder="joining date"
                                  value={empdetails.joiningdate}
                                  onChange={async (e) =>
                                    await handleempinputJoiningDate(e)
                                  }
                                  //   disabled={disableFields}
                                />
                              </Form.Group>
                            </Col>
                            <Col>
                              <Form.Group
                                as={Col}
                                controlId="formGridFirstName"
                                className="formmargin"
                              >
                                <Form.Label>Resignation Date</Form.Label>
                                <Form.Control
                                  type="date"
                                  required
                                  name="resignationdate"
                                  placeholder="resignation date"
                                  value={empdetails.resignationdate}
                                  onChange={async (e) =>
                                    await handleempinputResignationDate(e)
                                  }
                                  //   disabled={disableFields}
                                />
                              </Form.Group>
                            </Col>
                          </Row>
                          <Row>
                            <Form.Label>Job Description</Form.Label>
                            <Form.Group
                              as={Col}
                              controlId="formGridFirstName"
                              className="formmargin"
                            >
                              <Form.Control
                                as="textarea"
                                rows={"3"}
                                style={{ resize: "none" }}
                                required
                                name="jobdescription"
                                placeholder="Tell us about your job role & experience in previous company "
                                value={empdetails.jobdescription}
                                onChange={handleempinput}
                                //   disabled={disableFields}
                              />
                            </Form.Group>
                          </Row>
                          <div className="d-flex justify-content-center my-3">
                            <Button
                              onClick={() => {
                                addhistory();
                                Closechildmodal();
                              }}
                            >
                              Add Employement
                            </Button>
                          </div>
                        </Container>
                      </Modal.Body>
                    </Modal>
    </>
  );
};

export default Cards;
